function Menu (props){
    return(
        <div className="container">
            <div className="subcontainer">
                <div className="logo">
                    {props.title}
                </div>
                <div className="search">
                    <Search />
                </div>
                <div className="actions">
                    <button className="button btn-blue">+ Add New Book</button>
                </div>
            </div>
        </div>
    );
}

export default Menu;
